CUR_MEAN = mean(CUR_MEAS,2);
% 200 is the gain of the INA241A5
% 75 * 10^(-3) is the value of the current sensing resistor
CUR_VAL = CUR_MEAN(:,1) * 10^(-3) / 200 / (75 * 10^(-3));

S_ANGLE_V = zeros(9,9);
S_TRANS_V = zeros(9,9);
S_CURRENT = zeros(9,9);
S_POWER_C = zeros(9,9);
S_ANGLE_EFF = zeros(9,9);
S_TRANS_EFF = zeros(9,9);

% looping over duty cycle
for d = 1:9
    % read in the Vicon .csv file
    M = readtable('C:\Users\alexn\Documents\senior_thesis\joint_actuator23\actuator 2 3 frequency sweep '+string(d)+'.csv', 'ReadVariableNames', false);
    numRows = height(M) + 2;
    M = readmatrix('C:\Users\alexn\Documents\senior_thesis\joint_actuator23\actuator 2 3 frequency sweep '+string(d)+'.csv', 'Range', 'A6:H'+string(numRows));
    
    % unit processing
    M(:,2) = M(:,1) / 120;
    M(:,3) = M(:,3) * 180 / pi;
    M(:,4) = M(:,4) * 180 / pi;
    M(:,5) = M(:,5) * 180 / pi;

    % smoothing
    S = smoothdata(M,"gaussian",120); % window size of 120 to match frame/sampling rate

    % find initial index
    firstValidIndex = find(~isnan(M(:,5)), 1);
    
    % looping over frequency
    for f = 1:9
        % find initial and end frames for each frequency experiment
        init_frame = firstValidIndex+120*10*(f-1)+120*5*(f-1)+120*(f-1);
        if d == 2 || d == 6
            init_frame = firstValidIndex+120*10*(f-1)+120*5*(f-1)+127*(f-1);
        end
        end_frame = init_frame + 120*10;
        
        % calculate angular velocity
        S_ANGLE_V(d,f) = (S(end_frame, 5) - S(init_frame, 5)) / 10;
        
        % calculate magnitude of translational velocity
        v_x = (S(end_frame, 6) - S(init_frame, 6)) / 10;
        v_y = (S(end_frame, 7) - S(init_frame, 7)) / 10;
        S_TRANS_V(d,f) = sqrt(v_x^2 + v_y^2);

        % calculate current consumption and power
        S_CURRENT(d,f) = CUR_VAL((d-1)*9 + f, 1);
        S_POWER_C(d,f) = S_CURRENT(d,f) * 7.4; % 7.4 is the total input voltage to eViper

        % calculate rotational actuation efficiency
        S_ANGLE_EFF(d,f) = abs(S_ANGLE_V(d,f)) / S_POWER_C(d,f);
        % calculate translational actuation efficiency
        S_TRANS_EFF(d,f) = S_TRANS_V(d,f) / S_POWER_C(d,f);
    end
end

